import React, { Component } from 'react';
import axios from 'axios';
import {Button, Card, CardBody, CardHeader, Table } from 'reactstrap';
import {Sidebar, InputItem, DropdownItem, Icon, Item, Logo, LogoText} from 'react-sidebar-ui'

const url = (process.env.REACT_APP_DOMAIN) + ':' + (process.env.REACT_APP_PORT) + '/';

class TestsPage extends Component {
  constructor(props)
  {
    super(props);
    this.state = {      
      tests: [{
        "title": "test",
        "professor_id": "1",
        "max_score": "2",
        "questions": [
            {
                "title": "Ko je lenjivac",
                "points": "1",
                "answers": [
                    {
                        "title": "Zec",
                        "isCorrect": 0
                    },
                    {
                        "title": "Zmija",
                        "isCorrect": 1
                    },
                    {
                        "title": "Guster",
                        "isCorrect": 1
                    }
                ]
            },
                    {
                "title": "Ko je nesto drugo",
                "points": "1",
                "answers": [
                    {
                        "title": "Zec",
                        "isCorrect": 0
                    },
                    {
                        "title": "Orao",
                        "isCorrect": 1
                    },
                    {
                        "title": "Vrabac",
                        "isCorrect": 1
                    }
                ]
            }
        ]
    }
    ]          
    };

    this.getTests = this.getTests.bind(this);

  }

  componentDidMount(){
    //this.getTests()
}

  getTests(){
    axios({
      method: 'get',
      url: url + 'test',       
  }).then((response) => {
      console.log(response);
      this.setState({tests:response.data.students})
  }, (error) => {
      console.log(error);
  });
  }


  render() {
    return (
      <Card style={{ backgroundColor: "whiteSmoke" }}>
              <CardHeader>
                Testovi
              </CardHeader>
              <CardBody>
                <Table responsive>
                  <thead>
                  <tr>
                    <th>#</th>
                    <th>Name</th>
                    <th>Last name</th>
                  </tr>
                  </thead>
                  <tbody>
                  {(this.state.students).map((student, index) =>
                  <tr key={student.id}>
                    <td>{index + 1}</td>
                    <td>{student.name}</td>
                    <td>{student.last_name}</td>
                    <td><Button block className="btn-round" color="info"
                         >Edit</Button>
                    </td>
                    <td><Button block className="btn-round" color="info"
                         >Delete</Button>
                    </td>
                    </tr>
                    )}
                  </tbody>
                </Table>
              </CardBody>
            </Card>


    );
  }
}

export default TestsPage;
